import React, {Component} from 'react';
import "./common/css/index.css"
import {
    BrowserRouter as Router
} from "react-router-dom"
import Home from "./components/home"

class App extends Component {
    render() {
        return (
            <Router>
                <Home/>
            </Router>
        );
    }
}

export default App;
